package iam

func IsWildcardAllowed(actions ...string) (bool, string) {
	for _, action := range actions {
		var ok bool
		for _, allowed := range allowedActionsForResourceWildcards {
			if allowed == action {
				ok = true
				break
			}
		}
		if !ok {
			return false, action
		}
	}
	return true, ""
}

